import React, { useEffect } from "react";

import Navbar from "./components/Navbar/Navbar";
import Intro from "./components/Intro/Intro";
import Service from "./components/Services/Service";
import Works from "./components/Works/Works";
import Experience from "./components/Experience/Experience";
import Contact from "./components/Contact/Contact";
import Footer from "./components/Footer/Footer";

function App() {
   useEffect(() => {
    const colors = ["#ff6ec7", "#6ec1ff", "#a1ff6e", "#ffe66e", "#ff6e6e"];
    const blobs = document.querySelectorAll(".blob");
    const interval = setInterval(() => {
      blobs.forEach(blob => {
        const randomColor = colors[Math.floor(Math.random() * colors.length)];
        blob.style.backgroundColor = randomColor;
      });
    }, 5000); // every 5 seconds

    return () => clearInterval(interval);
  }, []);
  return (
    <div>
      <Navbar />
      <Intro />
      <Service />
      <Works />
      <Experience />
      <Contact />
      <Footer />
      <div className="blobs-container">
        <div className="blob" style={{ backgroundColor: "#ff6ec7" }}></div>
        <div className="blob" style={{ backgroundColor: "#6ec1ff" }}></div>
        <div className="blob" style={{ backgroundColor: "#a1ff6e" }}></div>
      </div>
    </div>
  );
}

export default App;
